INSERT INTO `contract_types` VALUES (1,0,5,'Employment','Travail','عقد التوظيف','desc_EN','Le contrat à durée déterminée (CDD) de E-Tafakna est un contrat de travail par lequel un employeur recrute un salarié pour une durée limitée. Un tel contrat n`est possible que pour l`exécution d`une tâche précise et temporaire et seulement dans les cas énumérés par la loi.Le contrat à durée indéterminée (CDI) de E-Tafakna est un contrat de travail par lequel un employeur recrute un salarié pour une durée indéterminée. Il ne prévoit pas la date à laquelle il prend fin. Il peut être rompu sur décision unilatérale soit de l’employeur, soit du salarié, ou encore pour une cause extérieure aux parties.Le contrat d’initiation à la vie professionnelle CIVP de E-Tafakna vise à répondre aux besoins en ressources humaines des entreprises du secteur privé. Ce type de contrat a pour objectif d’aider les jeunes diplômés à s’insérer dans la vie active et à acquérir de nouvelles compétences.','حطت على ذمتك مختلف عقود العمل من عقد الإعداد للحياة المهنية CIVP \nوالا عقد عمل محدد المدة  CDD وغير محدد المدة  CDI زادا\nوحتى من الfreelance.\nوبالطبيعة كانك مازلت ستاجيار/ة  تنجم تعمر شهادة التربص متاعك على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/travaille_y5oqzh.png','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084720/contract1_isna08_1_part1_esqffs.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084831/contract2_fiwvof_part2_i550oc.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084720/contract1_isna08_1_part1_esqffs.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084831/contract2_fiwvof_part2_i550oc.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084720/contract1_isna08_1_part1_esqffs.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084831/contract2_fiwvof_part2_i550oc.docx','Tunisia','types','categories','null'),(2,0,5,'Nda','NDA','اتفاق غير معلن','desc_EN','L’accord de confidentialité et de non divulgation NDA (Non Disclosure Agreement) de E-Tafakna est un contrat par lequel les parties s’engagent à conserver la confidentialité d’un certain nombre d’informations dont la teneur est définie par le contrat.','احمي المعلومات والمعطيات الخاصة والحساسة اللي تابعة الخدمة متاع الشركة متاعك باتفاقية سرية بينك وبين الشخص اللي عندك معاه خدمة على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670325480/New%20icons%20contracts/unnamed_bipsgv.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670495574/11._NDA_FR___Soci%C3%A9t%C3%A91_mo8pav.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671187200/NDA_ARABE_1_kqwkq6.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671187226/NDA_ARABE_2_rj0zge.docx','Tunisia','types','nda','null'),(3,0,5,'Training Certificate','Attestation de Stage','شهادة','In the broadest sense, a training certificate is a document certifying that the holder has taken a specific course of training.','Lattestation de stage E-Tafakna, aussi appelée le certificat de stage, est un document remis au stagiaire permettant de valider une expérience professionnelle au sein de lentreprise.','desc_AR','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/stage_ignntm.png','null','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670845854/Attestation-de-stage_n2_fffffffffffffffffffff_vskvis_1_os9fqw_imxrxt_1_arsmzt.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671452743/1._Attestation_Stage_AR_1_y9uidm.docx','Tunisia','types','attestation','null'),(4,0,2,'Loan Agreement','Prêt entre particuliers ','قرض بين الأفراد','desc_EN','Le contrat de prêt d’argent de E-Tafakna est un contrat qui documente et établit les conditions d’une entente financière entre deux parties, le prêteur et l’emprunteur. Le prêt entre particuliers est une formule de financement conclu directement par des personnes physiques, sans recourir à un établissement de crédit.','تنجم تكتب عقد القرض المالي في صورة ما انت وصاحبك تسلفتو فلوس وتحبو تتفكرو وتكتبو المعلومات اللي تخص السلفة الكل على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/pret_entre_particulier_vygdo9.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670945118/13._Pret_entre_partic_FR_lmg0o8.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671612852/12._Pret_entre_partic_AR_acojkm.docx','Tunisia','types','null','null'),(5,0,5,'Car','Voiture',' سيارة','desc_EN','Le contrat de vente de voiture de E-Tafakna est un contrat de vente qui doit être rédigé par le vendeur, et approuvé et signé par l’acheteur lors de l’achat d’une voiture d’occasion.Le contrat de location de voiture de E-Tafakna est un contrat de location qui doit être rédigé par le propriétaire, et approuvé et signé par le locataire lors de la location d’une voiture.','تلقى عقد بيع السيارة موجود تعميرو ساهل  وكيف كيف بالنسبة للكراء اذا قررت تكري كرهبتك ايامات على E-Tafakna','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/car_fh1tdl.png','temp_EN','temp_FR','temp_AR','Tunisia','types','car','null'),(6,0,5,'Rental of real estate','Location de biens','تأجير العقارات','desc_EN','Tout peut être loué en utilisant le contrat de location de E-Tafakna. Dune chambre, une villa, un appartement, à un bureau. Quil s&#39;agisse d`une location à court terme ou à long terme','محل للسكنى أو الاستعمال التجاري \nتحب تكري دار والا برتمان والا حتى حانوت سواء لمدة قصيرة وطويلة الكتنراتو متاعك تلقاه متوفرعلى ذمتك في E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/location_de_bien_prywdl.png','temp_EN','temple_FR','temp_AR','Tunisia','types','categorie','null'),(7,0,1,'Sale and purchase','Vente et Achat','بيع وشراء','desc_EN','Le contrat d’achat ou de vente de E-Tafakna est un contrat par lequel une partie s`engage à livrer un bien contre paiement à une autre partie.','بيع والا اشري السلعة متاعك والا غيرو بكنتراتو بش تضمن انو يكون كل شيء موثق ومطابق للطلب متاعك على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/Vente_Achat_duuhpn.png','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1664737567/Template_Contrat_de_location_bureau_n3_xvsszr.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670944235/10.Vente_Achat_FR_hmvixs.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671527286/9.Vente__Achat_AR_hrn54s.docx','Tunisia','types','null','null'),(8,0,1,'Engagement','Engagement','التزام','desc_EN','Le contrat d’engagement E-Tafakna nous permet de nous assurer que vous soyez prêt à entreprendre des travaux, avant de commencer à travailler plus en profondeur sur votre projet.',' عمر الالتزام متاعك مهما كان الموضوع متاعو بش تضمن انت وغيرك المفاهمات متاعكم على E-Tafakna','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/engagement_usouyg.png','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/raw/upload/v1665770960/WORD-CONTRACTS/Engagement_contract_n2_x14mz3_wg8rm1_gukspl.docx','https://res.cloudinary.com/dn6kxvylo/raw/upload/v1671452515/fff_mutfxc.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671804044/19._Engagement_1_ouvlfz_rl2k26.docx','Tunisia','types','null','null'),(9,0,2,'Partnership','Partenariat','عقد شراكة','desc_EN','Le contrat de partenariat de E-Tafakna, appelé également convention de partenariat, désigne un accord par lequel deux ou plusieurs parties s’associent pour mettre leurs forces et leurs ressources en commun afin d’accomplir un objectif également commun.','عمر الالتزام متاعك مهما كان الموضوع متاعو بش تضمن انت وغيرك المفاهمات متاعكم على E-Tafakna','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/partenariat_ze8q6p.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671176316/Document_sans_titre_37_lcare7.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671176343/Document_sans_titre_38_q3fjgo.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671803884/Document_sans_titre_54_mqali8.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671803889/Document_sans_titre_55_nfm3hn.docx','Tunisia','types','null','null'),(10,0,3,'Quotation/Bill','Devis/Facture ','فاتورة/devis','desc_EN','Le devis de E-Tafakna est d`abord un document d`information qui matérialise l`engagement des parties et qui doit être signé avant la prestation. La facture de E-Tafakna quant à elle, intervient à l`issue de la prestation. Il s`agit avant tout d`un document comptable tant pour le prestataire que pour le client.',' تلقى على ذمتك فاتورة وDevis يسهلولك خدمتك تعمرهم وين ما انت مع E-Tafakna ','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308746/New%20icons%20contracts/Devis_facture_yg4aee.png','temp_EN','https://res.cloudinary.com/dn6kxvylo/raw/upload/v1665755893/Template_facture_ymmtjd.xlsx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671710594/file_ytxvyd.xlsx','Tunisia','types','facture','null'),(11,0,1,'Certificate of honor','Attestation sur l`honneur','تصريح على الشرف','desc_EN','L`attestation sur l`honneur de E-Tafakna est une déclaration écrite et signée par laquelle son auteur atteste sur l`honneur d`un fait ou d`une situation.','كان عندك تصريح على الشرف تحب تعملو بش تصرح بصحة حادثة وقعت والا صحة معلومة, ماعليك كان تعمرتصريح على الشرف الموجود على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/decalaration_sur_lhonneur_ajcbuh.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671012604/15._Attestion_sur_l_honneur_FR_k5kfzu.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671522838/17._Attes_sur_l_honneur_AR_ywljoh.docx','Tunisia','types','null','null'),(12,0,1,'Safe of real estate','Domiciliation','شهادة في ايواء شركة','desc_EN','Le contrat de domiciliation E-Tafakna est une obligation pour toutes les sociétés, mais également pour les associations. Il sagit de ladresse administrative et fiscale à laquelle tous les courriers seront envoyés.','كانك مستعد/ة بش تقبل إيواء شركة عندك بمقابل وبش تقبل اوراقها الادارية, تنجم تعمر شهادة الإيواء على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308746/New%20icons%20contracts/domicilation_lucacc.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670947743/12._Domiciliation_3_bqokrh_rnvj4r.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671523832/11._Domiciliation_AR_ihxwbw.docx','Tunisia','types','null','null'),(13,0,2,'Freelancer','Freelance','عقد عمل حر','desc_EN','Le contrat de freelance de E-Tafakna permet à une personne travaillant à son compte (un « freelance ») de réaliser une mission, souvent ponctuelle ou de courte durée, pour le compte d’un ou plusieurs clients.','desc_AR','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/freelance_uydcui.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670942546/6.Freelance_FR_yxydei.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671616117/6._Freelance_AR_1_xxghll.docx','Tunisia','types','null','null'),(14,0,1,'Official request','Demande officielle','مطلب رسمي','desc_EN','Une demande Officielle E-Tafakna constitue effectivement une preuve réelle de la démarche engagée que l`on peut réaliser et apporter à toutes fins utiles.','كانك لازمك تعمر مطلب لاي ادارة والا غيرو تنجم تعمر المطلب متاعك بسهولة  بE-Tafakna','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308746/New%20icons%20contracts/demande_offficiel_kyzndt.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670849725/Demande_officielle_n4_m4cbe4_cfrc9c_1_u7vxsu_qpk8df.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671527964/18._Demande_Officielle_AR_ihn81h.docx','Tunisia','types','null','null'),(15,0,2,'Power of attorney','Procuration','توكيل','desc_EN','La procuration E-Tafakna est un contrat par lequel une personne en désigne une autre pour la représenter, agir en son nom, dans l’accomplissement d’un acte juridique avec un tiers.','اذا تحب تعطي توكيل لشكون والا انت بيدك بش تقوم بالتوكيل وتمثل شكون, تنجم تعمر التوكيل الموجود على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/procuration_nin84y.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670938116/9._Procuration_FR_1_b9prrb.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671528907/8._Procuration_AR_rxosie.docx','Tunisia','types','null','null'),(16,0,2,'Reference','Commision','عقد وساطة','desc_EN','Le contrat de commission de E-Tafakna est un accord destiné à être utilisé entre un fournisseur ou un prestataire de services et une autre entreprise qui réfère des clients potentiels au fournisseur ou au prestataire de services en échange d’une commission. Le commissionnaire est un intermédiaire du commerce qui conclut des contrats en son nom propre pour le compte d`un tiers, le commettant.','desc_AR','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/travaille_y5oqzh.png','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084720/contract1_isna08_1_part1_esqffs.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084831/contract2_fiwvof_part2_i550oc.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671539310/11._Commission_FR_bw5cgq_dg7eli.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671791595/10._Commission_AR_2_nau24h.docx','Tunisia','types','null','null'),(17,0,4,'CDI','CDI','عقد عمل غير محدد المدة','desc_EN','Le contrat à durée indéterminée (CDI) de E-Tafakna est un contrat de travail par lequel un employeur recrute un salarié pour une durée indéterminée. Il ne prévoit pas la date à laquelle il prend fin. Il peut être rompu sur décision unilatérale soit de l’employeur, soit du salarié, ou encore pour une cause extérieure aux parties.','desc_AR','https://res.cloudinary.com/dfctzd9p3/image/upload/v1664457759/unnamed_2_1_ztst4g.png','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084720/contract1_isna08_1_part1_esqffs.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084831/contract2_fiwvof_part2_i550oc.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671538824/Document_sans_titre_25_os3zlg_xevtht.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671025039/Document_sans_titre_26_yjfpjj.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671455658/Document_sans_titre_41_tohwlw.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671455665/Document_sans_titre_42_i0v6kg.docx','Tunisia','work','categories','inside_categories'),(18,0,3,'CDD','CDD','عقد عمل محدد المدة','desc_EN','Le contrat à durée déterminée (CDD) E-Tafakna est un contrat de travail par lequel un employeur recrute un salarié pour une durée limitée. Un tel contrat n’est possible que pour l’exécution d’une tâche précise et temporaire et seulement dans les cas énumérés par la loi.','desc_AR','https://res.cloudinary.com/dfctzd9p3/image/upload/v1664457759/unnamed_2_1_ztst4g.png','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/raw/upload/v1665748919/WORD-CONTRACTS/contract1_isna08_1_part1_esqffs_ycbrtu.docx,https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/raw/upload/v1665748967/WORD-CONTRACTS/contract2_fiwvof_part2_i550oc_doi7zp.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670853604/CDD_PART1_ziswne.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670852791/3._CDD_FR_ugesnp.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671454506/Document_sans_titre_39_gvi3oa.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671454513/Document_sans_titre_40_zvtxwu.docx','Tunisia','work','categories','inside_categories'),(19,0,4,'CIVP','CIVP','عقد الإعداد للحياة المهنية','desc_EN','Le contrat d`initiation à la vie professionnelle CIVP de E-Tafakna vise à répondre aux besoins en ressources humaines des entreprises du secteur privé. Ce type de contrat a pour objectif d’aider les jeunes diplômés à s’insérer dans la vie active et à acquérir de nouvelles compétences','desc_AR','https://res.cloudinary.com/dfctzd9p3/image/upload/v1664457759/unnamed_2_1_ztst4g.png','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084720/contract1_isna08_1_part1_esqffs.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1665084831/contract2_fiwvof_part2_i550oc.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670936326/Document_sans_titre_10_edbrox.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670936347/Document_sans_titre_11_mtka89.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670936368/Document_sans_titre_12_qunmbq.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670936389/Document_sans_titre_13_ljal1s.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671531677/Document_sans_titre_45_euobl9.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671531703/Document_sans_titre_46_oa4jfi.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671531722/Document_sans_titre_47_mxnlux.docx','Tunisia','work','categories','inside_categories'),(20,0,3,'Rental of real estate','Location à usage de bureau','تأجير للاستخدام المكتبي','desc_EN','Tout peut être loué en utilisant le contrat de location de E-Tafakna. D`une chambre, une villa, un appartement, à un bureau. Qu`il s’agisse d`une location à court terme ou à long terme','desc_AR','https://res.cloudinary.com/dfctzd9p3/image/upload/v1664457757/unnamed_16_1_drpr0x.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671538961/Document_sans_titre_1_zqfoit_2_p7j2xo_2_hysxi2.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670922587/Document_sans_titre_3_spsujy.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671461069/COMMERCIAL_ARABE_1_dqb9yq_1_rdwucj.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671461073/COMMERCIAL_ARABE_2_ii9us6_y0skif.docx','Tunisia','work','null','inside_categorie'),(21,0,3,'Rental of real estate','Location à usage d’habitation','عقد كراء محل سكني','desc_EN','Tout peut être loué en utilisant le contrat de location de E-Tafakna. D`une chambre, une villa, un appartement, à un bureau. Qu`il s’agisse d`une location à court terme ou à long terme','desc_AR','https://res.cloudinary.com/dfctzd9p3/image/upload/v1664457757/unnamed_16_1_drpr0x.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671021775/Document_sans_titre_4_a0y93b_fjw3bi.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671021851/Document_sans_titre_5_kyhgi0_1_ncopru.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671457776/Document_sans_titre_43_himhg5.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671457782/Document_sans_titre_44_aacgqj.docx','Tunisia','work','null','inside_categorie'),(22,0,2,'Car Sale','Vente de voiture','عقد بيع سيارة','desc_EN','Le contrat de vente de voiture de E-Tafakna est un contrat de vente qui doit être rédigé par le vendeur, et approuvé et signé par l’acheteur lors de l’achat d’une voiture d’occasion.','تلقى عقد بيع السيارة موجود تعميرو ساهل \nوكيف كيف بالنسبة للكراء اذا قررت تكري كرهبتك ايامات على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1665949430/icons/achat_voiture_j3ikzr.png','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670244199/9._Vente_voiture_FR_nubcjp.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670945637/14._Vente_voiture_FR_d7onih.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671525828/13.Vente_voiture_AR_q3uarp.docx','Tunisia','null','categories','car_categorie'),(23,0,2,'Car Rental','Location de voiture','عقد كراء سيارة','desc_EN','Le contrat de location de voiture de E-Tafakna est un contrat de location qui doit être rédigé par le propriétaire, et approuvé et signé par le locataire lors de la location d’une voiture.','تلقى عقد بيع السيارة موجود تعميرو ساهل \nوكيف كيف بالنسبة للكراء اذا قررت تكري كرهبتك ايامات على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1665949430/icons/achat_voiture_j3ikzr.png','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670244199/9._Vente_voiture_FR_nubcjp.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671028430/15._Location_de_VOITURE_1_nxju1r.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671792538/14._Loc_voiture_AR_qipgwl.docx','Tunisia','null','categories','car_categorie'),(24,0,3,'Quotation/Bill','Devis ','فاتورة/التسعير','desc_EN','Le devis de E-Tafakna est d`abord un document d`information qui matérialise l`engagement des parties et qui doit être signé avant la prestation. La facture de E-Tafakna quant à elle, intervient à l`issue de la prestation. Il s`agit avant tout d`un document comptable tant pour le prestataire que pour le client.',' تلقى على ذمتك فاتورة وDevis يسهلولك خدمتك تعمرهم وين ما انت مع E-Tafakna ','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1665949431/icons/facture_devis_ox5oml.png','temp_EN','https://res.cloudinary.com/dn6kxvylo/raw/upload/v1665755893/Template_facture_ymmtjd.xlsx','temp_AR','Tunisia','null','categories','facture'),(25,0,3,'Quotation/Bill','Devis ','فاتورة/التسعير','desc_EN','Le devis de E-Tafakna est d`abord un document d`information qui matérialise l`engagement des parties et qui doit être signé avant la prestation. La facture de E-Tafakna quant à elle, intervient à l`issue de la prestation. Il s`agit avant tout d`un document comptable tant pour le prestataire que pour le client.',' تلقى على ذمتك فاتورة وDevis يسهلولك خدمتك تعمرهم وين ما انت مع E-Tafakna ','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1665949431/icons/facture_devis_ox5oml.png','temp_EN','https://res.cloudinary.com/dn6kxvylo/raw/upload/v1665755893/Template_facture_ymmtjd.xlsx','temp_AR','Tunisia','null','categories','facture'),(26,0,1,'Nda','Protéger votre société','احمي شركتك','desc_EN','L’accord de confidentialité et de non divulgation\n NDA (Non Disclosure Agreement) de E-Tafakna est un contrat par lequel les parties s’engagent à conserver la confidentialité d’un certain nombre d’informations dont la teneur est définie par le contrat.','desc_AR','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670325480/New%20icons%20contracts/unnamed_bipsgv.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670948028/Document_sans_titre_17_fpluor.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670948059/Document_sans_titre_18_xpcx25.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670948080/Document_sans_titre_19_zxipgb.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671784275/Document_sans_titre_50_l5ykdl.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671784282/Document_sans_titre_51_v0lds9.docx','Tunisia','null','null','inside_nda'),(27,0,1,'Nda','Protéger votre projet','احمي مشروعك','desc_EN','L’accord de confidentialité et de non divulgation\n NDA (Non Disclosure Agreement) de E-Tafakna est un contrat par lequel les parties s’engagent à conserver la confidentialité d’un certain nombre d’informations dont la teneur est définie par le contrat.','desc_AR','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670325480/New%20icons%20contracts/unnamed_bipsgv.png','temp_EN','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671008024/Document_sans_titre_20_xewehq.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671008057/Document_sans_titre_21_ztw43g.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671008072/Document_sans_titre_22_pem8xr.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671547220/Document_sans_titre_48_xzmmqo.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671547229/Document_sans_titre_49_uh9d5k.docx','Tunisia','null','null','inside_nda'),(28,0,1,'Training Certificate','Attestation de stage','شهادة تربص','In the broadest sense, a training certificate is a document certifying that the holder has taken a specific course of training.','L’attestation de stage E-Tafakna, aussi appelée le certificat de stage, est un document remis au stagiaire permettant de valider une expérience professionnelle au sein de l’entreprise.','desc_AR','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/stage_ignntm.png','null','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670933770/1._Attestation_de_stage_FR_pw2dxk.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670317650/_1._Attestation_Stage_AR_fffffff_vjv8jp_2_z3llel.docx','Tunisia','null','null','attestation'),(29,0,1,'Training Certificate','Attestation de travail','شهادة عمل','In the broadest sense, a training certificate is a document certifying that the holder has taken a specific course of training.','L’attestation de travail de E-Tafakna est une attestation délivrée par l’employeur à un salarié, sur sa demande, permettant détablir officiellement, vis-à-vis des tiers, que le salarié est bien employé par l’entreprise.',' كانك تستحق شهادة عمل بش تثبت الّي انت تخدم حاليا، تنجم تعمّر شهادة العمل متاعك على E-Tafakna.','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/stage_ignntm.png','null','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671021376/5._Attestation_de_travail_FR_1_gmtczq.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671785603/5._Attestation_de_travail_AR_1_cdbkpq.docx','Tunisia','null','null','attestation'),(30,0,2,'Service','Prestation de service','تقديم الخدمات','In the broadest sense, a training certificate is a document certifying that the holder has taken a specific course of training.','Le contrat de prestation de services de E-Tafakna, est une convention en vertu de laquelle un travailleur indépendant est engagé pour exécuter une ou plusieurs missions pour le compte d’un particulier ou d’un professionnel.','بالطبيعة كانك ستاجيار/ة  تنجم تعمر شهادة التربص متاعك على E-Tafakna','https://res.cloudinary.com/dcscfcsdfrefrefreferfersdfersdf/image/upload/v1670308745/New%20icons%20contracts/stage_ignntm.png','null','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671119996/Document_sans_titre_35_uurvif.docx,https://res.cloudinary.com/dew6e8h2m/raw/upload/v1671120126/Document_sans_titre_36_qszadl.docx','https://res.cloudinary.com/dew6e8h2m/raw/upload/v1670317650/_1._Attestation_Stage_AR_fffffff_vjv8jp_2_z3llel.docx','Tunisia','types','null','null');
